import React, { useEffect, useState } from "react";
import { useParams } from 'react-router-dom';
import SimpleBackgroundCard from "examples/Cards/BackgroundCards/SimpleBackgroundCard";
import axios from "axios";
const ProductById = () => {
 const { productId } = useParams();
const[product,setProduct] = useState();
const [error, setError] = useState(null);
useEffect(() => {
    axios.get(`http://localhost:4500/products${productId}`)  
      .then((response) => {
        setProduct(response.data);
      })
      .catch((error) => {
        setError("Failed to retrieve products");
      });
  }, [productId]);
return(
<>
<SimpleBackgroundCard
  image="https://bit.ly/3zth6Nf"
  title="Last visits in US"
  description="Wealth creation is an evolutionarily recent positive-sum game. Status is an old zero-sum game. Those attacking wealth creation are often just seeking status."
/>
</>
);

}

export default ProductById;
